Come misurare l'ossigenazione del sangue:
1. Indossare l'orologio un dito dietro l'osso del polso, in una posizione comoda; 
2. Dopo essere entrati nella modalità di rilevazione dell'ossigeno nel sangue, rimanere fermi, assicurarsi che il polso sia piatto e che l'orologio sia rivolto verso l'alto. Se sei seduto, puoi appoggiare le braccia sul tavolo con l'orologio rivolto verso l'alto; 
3. Tieni il braccio fermo finché non ottieni il risultato finale.
